/* База данных интернет-аптеки*/

CREATE DATABASE apteka;
USE apteka;


DROP TABLE IF EXISTS `users`;
-- 1. Пользователи --
CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `password` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пароль',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `profile`;
-- 2.Профиль --
CREATE TABLE `profile` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор пользователя',
  `gender` varchar(10) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Пол пользователя',
  `bithday` date DEFAULT NULL COMMENT 'Дата рождения пользователя',
  `city` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Город',
  `country` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Страна',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



DROP TABLE IF EXISTS `cataloge`;
-- 3. Каталог --
CREATE TABLE `cataloge` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название каталога',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;





DROP TABLE IF EXISTS `subcataloge`;
-- 4. Подкаталог --
CREATE TABLE `subcataloge` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `catalode_id` int(10) unsigned NOT NULL COMMENT 'Идетнификатор каталога',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название подкаталога',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `product`;
-- 5. Продукт ---
CREATE TABLE `product` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `subcatalode_id` int(10) unsigned NOT NULL COMMENT 'Идетификатор подкаталога',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название подкаталога',
  `price` int(10) unsigned NOT NULL COMMENT 'Цена товара',
  `prod_date` date DEFAULT NULL COMMENT 'Дата производства',
  `doze` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Дозировка',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `product_description`;
-- 6. Описание продукта --
CREATE TABLE `product_description` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `product_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор продукции',
  `vendor_name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Производитель',
  `vendor_country` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Страна производитель',
  `desctiption` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание товара',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `basket`;
-- 7. Корзина --
CREATE TABLE `basket` (
  `id` int(10) unsigned NOT NULL COMMENT 'Идентификатор строки',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор пользователя',
  `product_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор продукции',
  `quantity` int(10) unsigned NOT NULL COMMENT 'Количество продукции',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`,`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



DROP TABLE IF EXISTS `order`;
-- 8. Заказ --
CREATE TABLE `order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `basket_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор корзины пользователя',
  `status_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор статуса заказа',
  `pick_point_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор пункта доставки',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- 9. Доставка --
CREATE TABLE `PickPoint` (
`id` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY COMMENT 'Идентификатор строки',
`country` VARCHAR(50) NOT NULL COMMENT 'Страна',
`city` VARCHAR(50) NOT NULL COMMENT 'Город',
`street` VARCHAR(50) NOT NULL COMMENT 'Улица',
`house_num` INT NOT NULL COMMENT 'Номер дома',
`created_at` DATETIME DEFAULT CURRENT_TIMESTAMP() COMMENT 'Дата создания строки',
`updated_at` DATETIME DEFAULT CURRENT_TIMESTAMP() COMMENT 'Дата последнего обновления строки'
);


-- 10. Отзыв --

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `product_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор продукции',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Идентификатор пользователя',
  `review` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Отзыв',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Дата создания строки',
  `updated_at` datetime DEFAULT current_timestamp() COMMENT 'Дата последнего обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- 11. Статус заказа --

CREATE TABLE `OrderStatus`(
  `id` INT UNSIGNED NOT NULL AUTO_INCREMENT PRIMARY KEY COMMENT 'Идентификатор строки',
  `status` VARCHAR(50)  COMMENT 'Статус заказа',
  `created_at` DATETIME DEFAULT CURRENT_TIMESTAMP() COMMENT 'Дата создания строки',
  `updated_at` DATETIME DEFAULT CURRENT_TIMESTAMP() COMMENT 'Дата последнего обновления строки'
);


ALTER TABLE profile ADD CONSTRAINT fk_profiles_users FOREIGN KEY (user_id) REFERENCES users(id);

ALTER TABLE subcataloge ADD CONSTRAINT fk_subcataloge_cataloge FOREIGN KEY (catalode_id) REFERENCES cataloge(id);

ALTER TABLE product ADD CONSTRAINT fk_product_subcataloge FOREIGN KEY (subcatalode_id) REFERENCES subcataloge(id);

ALTER TABLE product_description ADD CONSTRAINT fk_product_description FOREIGN KEY (product_id) REFERENCES product(id);

ALTER TABLE feedback ADD CONSTRAINT fk_product_feedback FOREIGN KEY (product_id) REFERENCES product(id);
ALTER TABLE feedback ADD CONSTRAINT fk_feedback_user FOREIGN KEY (user_id) REFERENCES users(id);

ALTER TABLE `basket` ADD CONSTRAINT fk_basket_user FOREIGN KEY (user_id) REFERENCES users(id);
ALTER TABLE `basket` ADD CONSTRAINT fk_basket_product FOREIGN KEY (product_id) REFERENCES product(id);

ALTER TABLE `order` ADD CONSTRAINT fk_order_basket FOREIGN KEY (basket_id) REFERENCES basket(id);
ALTER TABLE `order` ADD CONSTRAINT fk_order_status FOREIGN KEY (status_id) REFERENCES `OrderStatus`(id);
ALTER TABLE `order` ADD CONSTRAINT fk_order_pick_point FOREIGN KEY (pick_point_id) REFERENCES `PickPoint`(id);

CREATE INDEX basket_quantity_idx ON basket(quantity);
CREATE INDEX price_product_ind ON product(price);
CREATE INDEX cataloge_name_idx ON cataloge(name);
CREATE INDEX name_product_ind ON product(name);
